import React from 'react';
import GenLink from './GenLink.jsx';

const twitter = {
  href: 'https://twitter.com/HAL9000_',
  img: 'https://s3-us-west-2.amazonaws.com/s.cdpn.io/210284/social-twitter.svg',
  alt: 'twitter link',
}

const fandom = {
  href: 'https://2001.fandom.com/wiki/HAL_9000',
  img: 'https://avatars2.githubusercontent.com/u/1171011?s=200&v=4',
  alt: 'fandom link'
}

const wikipedia = {
  href: 'https://en.wikipedia.org/wiki/HAL_9000',
  img: 'https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fen%2Fthumb%2F8%2F80%2FWikipedia-logo-v2.svg%2F1200px-Wikipedia-logo-v2.svg.png&imgrefurl=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FFile%3AWikipedia-logo-v2.svg&tbnid=yYtnXPVPjjrUoM&vet=12ahUKEwip95mT9P7pAhXz7uAKHVgEA8MQMygAegUIARCkAQ..i&docid=gaVbEGVyv-QBIM&w=1200&h=1095&q=wikipedia%20logo&hl=en&client=ubuntu&ved=2ahUKEwip95mT9P7pAhXz7uAKHVgEA8MQMygAegUIARCkAQ',
  alt
}

class Links extends React.Component {
  render() {
    return (
      <ul className='profile-social-links'>
        <GenLink
          href={twitter.href}
          img={twitter.img}
          alt={twitter.alt}
        />
        <GenLink
          href={fandom.href}
          img={fandom.img}
          alt={fandom.alt}
        />

      </ul>

    );
  }
}

export default Links;
